package leetcode2;

import java.util.ArrayList;
import java.util.Arrays;
import java.util.Collections;
import java.util.HashMap;
import java.util.HashSet;
import java.util.List;

public class FindAllAnagramsString {

    public static void main(String[] args) {
        System.out.println(new FindAllAnagramsString().findAnagrams("", ""));

        // System.out.println(new FindAllAnagramsString().findAnagrams("abab", "ab"));

    }

    public List<Integer> findAnagrams(String s, String p) {

        if (s.length()<p.length()) {
            return Collections.emptyList();
        }

        HashMap<Character, Integer> map = new HashMap<>();

        for (int i = 0; i < p.length(); i++) {
            map.put( p.charAt(i), map.getOrDefault(p.charAt(i), 0)+1);
        }

        List<Integer> result = new ArrayList<>();

        for (int i = 0; i < s.length(); i++) {
            if (i<p.length()) {
                map.put(s.charAt(i), map.getOrDefault(s.charAt(i), 0)-1);
                if (map.getOrDefault(s.charAt(i), 0) == 0) {
                    map.remove(s.charAt(i));
                }
            
                if (map.isEmpty()) {
                    result.add(0);
                }
            } else {
                map.put( s.charAt(i), map.getOrDefault(s.charAt(i), 0)-1);

                if (map.getOrDefault(s.charAt(i), 0) == 0) {
                    map.remove(s.charAt(i));
                }

                map.put( s.charAt(i-p.length()), map.getOrDefault(s.charAt( i-p.length() ), 0) + 1);

                if (map.getOrDefault(s.charAt( i-p.length() ), 0) == 0) {
                    map.remove(s.charAt( i-p.length() ));
                }

                if (map.isEmpty()) {
                    result.add(i-p.length()+1);
                }
            }

        }

        return result;

    }


    public List<Integer> findAnagrams2(String s, String p) {

        if (s.length()<p.length()) {
            return Collections.emptyList();
        }

        char[] pc = p.toCharArray();
        Arrays.sort(pc);
        String newp = new String(pc);

        List<Integer> result = new ArrayList<>();

        HashMap<String, Boolean> cache = new HashMap<>();

        for (int i = 0; i < s.length() ; i++) {
            if (i+p.length()<=s.length()) {
                String ss = s.substring(i, i+p.length());
                if (cache.get(ss)!=null && cache.get(ss)) {
                    result.add(i);
                } else

                if (isanagrams(s.substring(i, i+p.length()), newp, cache)) {
                    result.add(i);
                }
            }
        }
        return result;

    }



    private boolean isanagrams(String sub, String p, HashMap<String, Boolean> cache) {
        char[] subc = sub.toCharArray();
        Arrays.sort(subc);
        String newsub = new String(subc);

        if (cache.get(newsub) != null) {
            return cache.get(newsub);
        }

        boolean r = newsub.equals(p);

        cache.put(newsub, r);

        return r;
    }
}
